import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

const Section = styled.section`
  min-height: 600px;
  width: 100%;
  display: flex;
  flex-direction: column;
  // align-items: center;
  justify-content: center;
  border: 1px solid grey;
`;
const Header = styled.header`
  display: flex;
  flex-direction: column;
  align-items: center;
`;
const H3 = styled.h3`
  font-size: 20px;
`;
const ProjectList = styled.div`
  width: 100%;
  border: 1px solid black;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-evenly;
`;

const Project = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  width: 30%;
  height: 400px;
  border: 1px solid orange;
`;

const ProjectPane = () => {
  return (
    <Section>
      <Header>
        <H3>Projects</H3>
      </Header>
      <ProjectList>
        <Project>FEC</Project>
        <Project>SDC</Project>
        <Project>MVP</Project>
      </ProjectList>
    </Section>
  );
};

export default ProjectPane;
